import React from "react";
import { ThemeProvider } from "theme-ui";
import theme from "../src/styles/theme";
import Nav from "../src/component/nav";
function App({ Component, pageProps }) {
  return (
    <>
      <ThemeProvider theme={theme}>
        <div>
          <Nav />
          <Component {...pageProps} />
        </div>
      </ThemeProvider>
    </>
  );
}

export default App;
